int jumpSearch(int arr[], int n, int target) {
    int step = sqrt(n); // Step size
    int prev = 0;

    // Jump forward until the target is less than or equal to the current element
    while (arr[step - 1] < target && step < n) {
        prev = step;
        step += sqrt(n);
        if (step > n) {
            step = n; // Set the step to the last element
        }
    }

    // Perform a linear search with current chunk
    for (int i = prev; i < step; i++) {
        if (arr[i] == target) {
            return i; // Return the index where target is
        }
    }

    return -1; // Return -1 if the target is not found
}

